import React from 'react';

function Footer() {
    return(
        <footer>
            <div>
                <a className="footer-link" href="linkdin.com">LinkdIn</a>
            </div>
            <div>
                <a className="footer-link" href="Github.com">Github</a>
            </div>
            <div>
                <a className="footer-link" href="Twitter.com">Twitter</a>
            </div>
        </footer>
    )
}
export default Footer;
